import React from 'react';
import './SidePictures.css';

const SidePictures = () => {
  // Example images array – replace with your own URLs
  const pictures = [
    { src: '/images/image1.jpeg', alt: 'Us at the park' },
    { src: '/images/image2.jpeg', alt: 'Us on vacation' },
    { src: '/images/image1.jpeg', alt: 'Silly selfie' },
  ];

  return (
    <div className="side-pictures-container">
      {pictures.map((pic, index) => (
        <div className="picture-wrapper" key={index}>
          <img src={pic.src} alt={pic.alt} className="side-picture" />
        </div>
      ))}
    </div>
  );
};

export default SidePictures;
